import React from 'react';
import { logout } from "../../actions/currentAccount.js";


const Logout = ({logout}) => {
  return (
      <div className="Logout">
        <form onSubmit={this.logout()}>
          <input
            type="submit"
            value="Logout"
          />
        </form>
      </div>
  );

}

export default Logout
